import React from 'react'


function Avatar (props) {
   return (
   <div style={ {backgroundColor:"#FF0000"}}>
      <img src={props.user.url} alt={props.user.name}/> 
      <br/>
      <span>{props.user.name}</span>
   </div>
   )
}

function App() {

   let user = {
      url:"https://tudosobrehospedagemdesites.com.br/site/wp-content/uploads/2019/04/2-uniqueness-728x298.png",
      name: "Rodrigo Silva"
   }
   return<>

   <Avatar user={user}/>

   </>
}

export default App;
